import React from 'react';
import './App.css';
import {Switch, Route} from "react-router-dom";
import Products from './components/Products/Products.js';

function App() {

  return (
    <Switch>
     <h1>My App</h1>
     <Products/>
     <Route exact path="/product/:sku" component={ProductListPage}/>
    </Switch>
  );
}

export default App;
